import React from 'react';
import './selection-page.css';

function SelectionPage({ setUserType }) {
    const handleAlumniClick = () => {
        setUserType('alumni');
        navigate('/signup');
    };

    const handleStudentClick = () => {
        setUserType('student');
        navigate('/signup');
    };

    return (
        <div className="selection-container">
            <div className="half-circle"></div>
            <div className="content">
                <h1>Select your Relation with College or Institute</h1>
                <button onClick={handleAlumniClick}>Alumni</button>
                <button onClick={handleStudentClick}>Student</button>
            </div>
        </div>
    );
}

export default SelectionPage;
